import React, { Fragment } from "react";
import Head from "next/head";

const Home = () => {
  return (
    <Fragment>
      <Head>
        <title>Oddschecker - Home</title>
      </Head>
      <div>Hello my Little friend</div>
    </Fragment>
  );
};

export default Home;
